#pragma once
#include "../common.hpp"
template<typename T>
Vec<T> divisors(const T n)
{
    Vec<T> head, tail;
    for (T i = 1; i * i <= n; i++) {
        if (n % i == 0) {
            head.push_back(i);
            if (i * i != n) { tail.push_back(n / i); }
        }
    }
    reverseAll(tail);
    concat(head, tail);
    return head;
}
